import React, { useState } from 'react';
import Paper from '@mui/material/Paper';
import { Typography } from '@mui/material';
import { styled } from '@mui/system';
import Button from '@mui/material/Button';
import useAxiosPrivate from '../hooks/useAxiosPrivate';
import TableContainer from '@mui/material/TableContainer';
import { Link } from 'react-router-dom';
import Appbar from './Appbar';

const SearchContainer = styled('div')({
  padding: '1em',
  margin: '1em auto',
  maxWidth: '800px',
});

const AdvancedSearch = () => {
  const axiosPrivate = useAxiosPrivate();
  const [searchCriteria, setSearchCriteria] = useState({
    departmentName: '',
    functionName: '',
    applicationName: '',
    menuName: '',
    fileName: '',
    author: '',
    description: '',
    uniqueMenuId: false,
  });
  const [searchResults, setSearchResults] = useState([]);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setSearchCriteria({ ...searchCriteria, [name]: value });
  };

  const handleCheckboxChange = (event) => {
    setSearchCriteria({ ...searchCriteria, uniqueMenuId: event.target.checked });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await axiosPrivate.get('/search', { params: searchCriteria });

      if (response?.data) {
        setSearchResults(response.data);
      }
    } catch (error) {
      console.error('Error performing search:', error);
    }
  };

  const rowSt = {
    display: 'grid', gridTemplateColumns: '1fr 1fr',
    alignItems: 'center', padding: '2px', borderBottom: '1px solid black',
  };

  const headSt = {
    fontSize: '1em',
    fontWeight: 'bold'
  };

  return (
    <SearchContainer style={{display : 'grid',gap : '2cm'}}>
      <Appbar />
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="departmentName"
          value={searchCriteria.departmentName}
          onChange={handleInputChange}
          placeholder="Department Name"
        />
        <input
          type="text"
          name="functionName"
          value={searchCriteria.functionName}
          onChange={handleInputChange}
          placeholder="Function Name"
        />
        <input
          type="text"
          name="applicationName"
          value={searchCriteria.applicationName}
          onChange={handleInputChange}
          placeholder="Application Name"
        />
        <input
          type="text"
          name="menuName"
          value={searchCriteria.menuName}
          onChange={handleInputChange}
          placeholder="Menu Name"
        />
        <input
          type="text"
          name="author"
          value={searchCriteria.author}
          onChange={handleInputChange}
          placeholder="Author"
        />
        <input
          type="text"
          name="description"
          value={searchCriteria.description}
          onChange={handleInputChange}
          placeholder="Description"
        />
        <label>
          Unique Menu ID:
          <input
            type="checkbox"
            name="uniqueMenuId"
            checked={searchCriteria.uniqueMenuId}
            onChange={handleCheckboxChange}
          />
        </label>
        <Button variant="contained" type="submit">
          Search
        </Button>
      </form>
      <div>
          {searchResults && searchResults.map((result) => (
            <div
              key={result.id}
              className="box-container"
              style={{
                // Add styling for each result box
                backgroundColor: '#ffffff',
                borderRadius: '10px',
                padding: '1em',
                marginBottom: '2em',
                boxShadow: '0 8px 16px -8px rgba(0, 0, 0, 0.3)',
              }}
            >
              {/* Render the content of each Data object */}
              <TableContainer component={Paper} sx={{ maxWidth: '30vw', margin: 'auto', marginBottom: '2em' }}>
                <Link to={`/details/${result.menu.menuId}`}>
                  <div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Author :
                      </div>
                      <div>
                        {result.author}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Department :
                      </div>
                      <div>
                        {result.menu.application.function.department.departmentName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Function :
                      </div>
                      <div>
                        {result.menu.application.function.functionName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Application :
                      </div>
                      <div>
                        {result.menu.application.applicationName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Menu :
                      </div>
                      <div>
                        {result.menu.menuName}
                      </div>
                    </div>
                    <div style={rowSt}>
                      <div style={headSt}>
                        Description :
                      </div>
                      <div>
                        {result.menu.description}
                      </div>
                    </div>
                  </div>
                </Link>
              </TableContainer>

            </div>
          ))}
        </div>
    </SearchContainer>
  );
};

export default AdvancedSearch;
